import React from 'react'

export default function CatPosts(){
    return(
        <div style={{display:"flex",justifyContent:"space-between",marginRight:"5%",marginLeft:"5%"}}>
            <div className="catJogos">Jogo recente</div>
            <div className="catAnimes">Anime recente</div>
            <div className="catFilmes">Filmes recente</div>
        </div>
    )
}
